import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Rotas from './routes';
import 'antd/dist/antd.css';
import { Layout,Header } from 'antd';
import Menu from './protected/components/Menu';
function App() {
  return (
      <Layout>
        <Header>
          <Menu></Menu>
        </Header>
      <Rotas></Rotas>
      </Layout>
  );
}

export default App;
